import React from 'react';
import styles from './styles/SearchResults.module.css'
//import Songs from './Songs';


// componenta primeste props de la App parent
// p isi va schimba starea, vom implementa logica cu useState in App parent 
// SearchResults e parent pt Song
// ia props songs de la App parent si da prop songs mai departe la child 
function SearchResults({songs}){
    return(
        <div className={styles.searchResDiv}>
            <h2 className={styles.h2}>Results</h2>
            <ul>
                <li></li>
              {songs}
            </ul>
        </div>
    );
}   

export default SearchResults;   


